@TheJmaster6 Hi, I can unfortunately not look at bookings or refund issues here on Twitter. Please contact our customer service with the booking reference for assistance.  https://t.co/b3QIqPk7bj

Regards,
Peter

@vashtie Hi,  Customer service can not check in bookings in advance. Online check in can be done through https://t.co/thlh8GBb1t from 30 hours before departure for our flights or at the airport.

Regards,
Peter

@AirlineFlyer Hi, Our lounge in Newark opened November 1st.

Regards,
Peter

@petchmo Hi Ian
At the moment it is closed.

Best regards /Anna

@iShrutiDugar Hi! 

I'm sorry that your brothers bag went missing. The best i can recommend in that case is to call our baggage handling department at +46 (0)771 224 243.
Please also remove this text later as it has your brothers reference and PIR number in it.

//Best regards, Dennis.

@TheJmaster6 Hi, have you been in contact with customer service for help with looking at the refund case? If not please contact us on live-chat or phone https://t.co/b3QIqPk7bj

Best regards,
Anton.

@supra_dig 2/2 Efter att de godkänt dina covid-19 dokument vid incheckningen så kommer du att få ditt boardingkort. Vi rekommenderar att man är på flygplatsen cirka 2 timmar före planerad avresa.

Med vänlig hälsning,
Anton.

@supra_dig Okej, ja då kan du behöva gå till incheckningen på flygplatsen och styrka ditt medborgarskap med ett pass/nationellt ID-kort där då Sverige i vanliga fall kräver negativt test eller vaccinintyg vid inresa från UK med undantag för svenska medborgare.

Med vänlig hälsning,
Anton.

@supra_dig Hej, det kan bero på lite olika saker men vanligaste orsaken är att man reser till en destination som kräver någon form av covid-19 dokumentation (vaccinintyg, negativt test etc) som behöver godkännas på flygplatsen innan man kan få boardingkortet.

Med vänlig hälsning,
Anton.

@EN_Bull Hi, it seems the website is not able to take into account that your itinerary has been changed then. Please contact us again on live-chat and we can help you cancel and apply for refund there https://t.co/b3QIqPk7bj

Best regards,
Anton.

@PeterChalkley3 Hi Peter
It is hard to say without looking at the booking but sometimes online check in is not offered for the travel or the airport want the check in to be at the airport.
Kind regards /Anna

@grumblingjay Hello
It is SAS customer care that handles complaints and requests of compensation, we can not assist you via Twitter, you contact customer care via https://t.co/cE0TvFYaMV
Kind regards /Anna

@7Marivold Hej
Det kan vara längre köer på dagen då många kontaktar oss just nu i denna period, det är knappval 2 för ändringar  i talsvaret och  knappval 3 för bonusbiljetter. Hoppas att det löste sig med ombokningen.
Vänliga hälsningar /Anna

@TobbeSchioth Hi Tobbe
Please contact us on Facebook messenger or live chat https://t.co/b3QIqPk7bj with your booking and we will look at this.
Kind regards/ Anna

@c_ceasar Hello
Number to Hamburg is  +49 30 221 8272 130 and they should be able to help you further, usually the airport contacts you when the luggage has arrived to final destination airport and you can check status online via World Tracer.
Kind regards /Anna

@Hikedtheworld Hello
You are welcome to contact customer service via Facebook messenger , live chat or phone https://t.co/b3QIqPk7bj  and we will look at what has happened with your refund.
Kind regards /Anna

@Ayuri77S Hi! 

I'm sorry if you had a negative experience regarding your refund, we sadly can't do a full refund in those cases so i recommend that you contact a insurance and check if they can cover the rest in this case.

//Best regards, Dennis.

@MarioLaganaIII Hi! 

I'm sorry about the delay. If you would like to submit your comments or complaints, please contact our Customer Care department.
You can contact them via this link:
https://t.co/OzrIxYNv63 and select "General Complaint or compliment".

//Best regards, Dennis.

@adelcampop Hi! 

Okay, i'm sorry to hear that. But the best i can recommend in that case is to send it in to us via this link: https://t.co/Y7XCcQ5U7a

//Best regards, Dennis.

@adelcampop Hi! 

Okay, For assistance with changes or refund of your ticket, I ask you to contact the selling travel agency. But if they don't answer then i recommend that you contact our customer service by phone or chat so we can help you have a look.

//Best regards, Dennis.

@JillScottDodd Hi, I unfortunately can not check bookings or refunds here on Twitter. Please contact our customer service with the booking reference, they can check that the booking is cancelled and on queue for refund.  https://t.co/b3QIqPk7bj

Regards,
Peter

@ReglindisDR Hi, I can unfortunately not check Customer care cases here on Twitter. Please contact our customer service for assistance.   https://t.co/b3QIqPk7bj

Regards,
Peter

@grumblingjay Hello! We are very sorry for the inconvenience. Unfortunatly there is a bit longer waiting time to our customer care department right now. 

Best regards,
Jenny

@grumblingjay Hello! We are very sorry for the inconvenience. If you wish to leave a complaint about this, you are welcome to fill our feedback form here: https://t.co/OzrIxYNv63

Best regards,
Jenny

@emmalou288 Hello! Electronics should always be packed in the carry on luggage. You also need to check that the batteries are not stronger than 100 Wh.

Best regards,
Jenny

@dirkahlers Hello! We follow the governments recommendations. You can read more about this, here: https://t.co/E6bpHzaWLm

Best regards,
Jenny

@emmalb72 Hello! If you need help with the rebooking, please contact us by phone and we will help you. You can find our contact numbers here: https://t.co/b3QIqPk7bj

Best regards,
Jenny

@brillemann Hej! Vi ber om ursäkt för besväret. Om du önskar att lämna ett klagomål till oss angående detta så är du välkommen att fylla i vårt feedback formulär. Du hittar formuläret här: https://t.co/OzrIxYNv63

Med vänliga hälsningar,
Jenny

@blackapinay Hello! You can find the max dimension for carry-on here: https://t.co/2UUXPRN2w1. Business will firstly be considered. If there are no seats left in business you will recieve the PLUS upgrade.

Best regards,
Jenny

@AlenaLugovkina Hello! Unfortunatly we can not give a full refund for the ticket if there was no cancelled/delayed flight. If you wish to leave a complaint regarding this, you are welcome to fill in our feedback forms. You can find the form here: https://t.co/OzrIxYNv63

Best regards,
Jenny

@TheJmaster6 Hello, please contact us over live-chat or phone with your booking details and we can help you take a look at the status of your refund case https://t.co/b3QIqPk7bj

Best regards,
Anton.

@LudivineMFGE Hi! 

I apologize if you had a negative experience with our service. But the best i can recommend in that case is to reply to the last email you received from Customer Care. The agent will respond to you as soon as possible.

//Best regards, Dennis.

@Fondacey Hello
At the moment we have no available seats for direct flight during January 2022 unfortunately, you can see our available tickets via https://t.co/BlgfvicYhk
Kind regards/Anna

@Wrightyp5 Hello
We plan our upcoming routes for approximately 330 days in advance, which means that you will find our planned alternatives on the website when you search for the desired route.

Kind regards, Anja!

@janetmack67 Hello!
You can check the status of your submitted documents if you reopen the booking via https://t.co/qN8gOdYYzJ. You will also be contacted by us when the case has been handled.

Kind regards, Anja!

@simoncollins8 Hello Simon!

We are sorry about the inconvenience, I'm assuming you got these vouchers at the airport in order to buy food while waiting - if you would like to make a complaint then please use this link: https://t.co/wprQ9Zejqh

Best regards, Emilia

@TheJmaster6 Hi, We can unfortunately not look at bookings or refund here on Twitter. Please contact us through our chat or phone support with the booking reference so we can check your booking.  https://t.co/b3QIqPk7bj

Regards,
Peter

@MiiguelCastilla Hi, We have received info that there is a issue for some passengers to rebook and our IT department are looking into it.  You can call in to our support and rebook if the booking can not be changed on the homepage.  https://t.co/b3QIqPk7bj

Regards,
Peter

@Delphina722 Hello! We are sorry for the long waiting time on our live chat and phone. If you need help with a prepaid add on like extra baggage, you need to call us so we can help you with this.

Kind regards,
Jenny

@TheSoccerDucks Hello! Unfortunatly we can not help you with this on Twitter. If you need help with the rebooking possibilities, please contact our phone support. You can find our contact information here: https://t.co/b3QIqPk7bj

Kind regards,
Jenny

@siljel Hej! Avbokningsavgiften för en PLUS smart biljett är 70 euro per person och resväg. Avbokar du då en tur och retur, så blir avbokningsavgiften 140 euro för den.

Med vänliga hälsningar,
Jenny

@RacketClubbb Hello! In this case, you have to call baggage service on your home airport, so they can arrange for the baggage to be reunited with you. You can find the contact information for respective airports here: https://t.co/ZV9bTO3uo2

Kind regards,
Jenny

@Delphina722 Hi! Unfortunatly we can not help you with this on Twitter. If you need help with this, please contact us by phone or live chat. You can find our contact information here: https://t.co/b3QIqPk7bj

Kind regards,
Jenny

@didactic_dude Hello! The validity of the ticket is 1 year so if you book july 2022, the return flight has to be at latest in july 2023. 

Kind regards,
Jenny

@RacketClubbb Hi! If she needs help with how to report her baggage missing, please contact us on phone or live chat and we will guide her. You can find our contact information here: https://t.co/b3QIqPk7bj

Kind regards,
Jenny

@TheJmaster6 Hi, if you want to open a claim with us regarding the refund case please proceed to https://t.co/wprQ9Zejqh to open a case with our Customer Care department.

Best regards,
Anton.

@SFKainz Hi and sorry for the late response. I hope this was able to be sorted out on the airport, if not please contact us on the phone with your booking details https://t.co/b3QIqPk7bj for assistance with rebooking.

Best regards,
Anton.

@herslowism Hi. I'm sorry to hear that you and your travel company was split up due to the change of seating. If you wish to see what possibilities there are for compensation please open a claim with our Customer Care department at https://t.co/wprQ9Zejqh

Best regards,
Anton.

@TheJmaster6 Hello, please contact our support on live-chat or phone with your booking details and they can help you take a look at the refund case https://t.co/b3QIqPk7bj

Best regards,
Anton.

